css:
.svg-preview {
  background-color: #282c34;
}
.svg-preview .image-controls {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px;
  border-bottom: 1px solid #181a1f;
  background-color: #282c34;
}
.svg-preview .image-controls a {
  display: inline-block;
  width: 24px;
  height: 24px;
  margin: 5px;
  vertical-align: middle;
  font-size: 0;
  border-radius: 22px;
  border: 2px solid #fff;
  box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.4), 0 0 0 1px rgba(0, 0, 0, 0.1), 0 2px 2px rgba(0, 0, 0, 0.2);
}
.svg-preview .image-controls a:hover {
  border-color: #ccc;
}
.svg-preview .image-controls a:active {
  border-color: #999;
}
.svg-preview .image-controls .btn-group {
  margin: 5px;
}
.svg-preview .image-controls .reset-zoom-button {
  min-width: 5em;
}
.svg-preview .image-canvas {
  box-sizing: border-box;
  overflow: scroll;
  width: 100%;
  height: calc(100% - 44px);
  padding: 5px;
  flex: 1 1 0;
  display: flex;
  overflow: auto;
}
.svg-preview .image-canvas svg {
  flex: none;
  margin: auto;
}
.svg-preview[background="white"],
.svg-preview .image-controls-color-white {
  background-color: #e3e3e3;
  background-size: 10px 10px;
  background-position: 0 0, 5px 5px;
  background-image: linear-gradient(45deg, #ffffff 25%, transparent 25%, transparent 75%, #ffffff 75%, #ffffff), linear-gradient(45deg, #ffffff 25%, transparent 25%, transparent 75%, #ffffff 75%, #ffffff);
}
.svg-preview[background="black"],
.svg-preview .image-controls-color-black {
  background-color: #2b2b2b;
  background-size: 10px 10px;
  background-position: 0 0, 5px 5px;
  background-image: linear-gradient(45deg, #000000 25%, transparent 25%, transparent 75%, #000000 75%, #000000), linear-gradient(45deg, #000000 25%, transparent 25%, transparent 75%, #000000 75%, #000000);
}
